import React from 'react';
import './Main.css';
import Header from '../header/Header';

export default props => (
    <>
        <Header {...props} />
        <main className="content container-fluid" >
            <div className="p-3 mt-3" >
                {props.children}
            </div>
        </main>
    </>
)
